    <script type="application/json" id="p1489">
      {"b91a048f-c97a-4ca2-a281-52409a0f1663":{"version":"3.3.1","title":"Bokeh Application","roots":[{"type":"object","name":"Tabs","id":"p1480","attributes":{"sizing_mode":"stretch_both","tabs":[{"type":"object","name":"TabPanel","id":"p1471","attributes":{"title":"Summary","child":{"type":"object","name":"Div","id":"p1470","attributes":{"styles":{"type":"map","entries":[["width","100%"],["height","100%"],["max-width","1920px"],["max-height","1080px"],["padding","12px"],["border","1px solid lightgray"],["box-shadow","inset 1px 0 8px 0 lightgray"],["overflow","auto"]]},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 479.87 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 340 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 37m 51s &lt;/li&gt;\n&lt;li&gt; transfer time: 34.79 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.116.246.6:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 1 &lt;/li&gt;\n          &lt;li&gt; Threads: 1 &lt;/li&gt;\n          &lt;li&gt; Memory: 13.97 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2023.11.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2023.11.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef execute_benchark(config_args, client, cluster, graph):\n    from dask.distributed import as_completed\n\n    dask_graph = to_dask_graph(graph)\n    outputs = [Delayed(x.name, dask_graph) for x in graph.sinks]\n\n    with performance_report(f\"{config_args.output_dir}/performance_report.html\"):\n        future = client.compute(outputs)\n\n        seq = as_completed(future)\n        del future\n        # Trigger gargage collection on completed end tasks so scheduler doesn't\n        # try to repeat them\n        errored_tasks = 0\n        for fut in seq:\n            if fut.status != \"finished\":\n                print(f\"Task failed with exception: {fut.exception()}\")\n                errored_tasks += 1\n            pass\n\n    # Save logs\n    if config_args.local:\n        logs = client.get_worker_logs()\n        for index, (pod, pod_log) in enumerate(logs.items()):\n            with open(f\"{config_args.output_dir}/worker-{index}.log\", \"w\") as logfile:\n                for log_line in pod_log:\n                    logfile.write(f\"{log_line}\\n\")\n        scheduler_log = client.get_scheduler_logs()\n        with open(f\"{config_args.output_dir}/scheduler.log\", \"w\") as scheduler_logfile:\n            for log_line in scheduler_log:\n                scheduler_logfile.write(f\"{scheduler_log}\\n\")\n    else:\n        time.sleep(60)\n        env = {\"KUBECONFIG\": os.environ[\"KUBECONFIG\"], \"PATH\": os.environ[\"PATH\"]}\n        subprocess.run(\n            [\n                \"kubectl\",\n                \"logs\",\n                f\"{cluster.scheduler._pod.metadata.name}\",\n            ],\n            env=env,\n            stdout=open(f\"{config_args.output_dir}/scheduler.log\", \"w\"),\n            stderr=subprocess.STDOUT,\n            check=True,\n        )\n        for i, x in cluster.workers.items():\n            subprocess.run(\n                [\n                    \"kubectl\",\n                    \"logs\",\n                    f\"{x._pod.metadata.name}\",\n                ],\n                env=env,\n                stdout=open(f\"{config_args.output_dir}/worker-{i}.log\", \"w\"),\n                stderr=subprocess.STDOUT,\n                check=True,\n            )\n\n    if errored_tasks != 0:\n        raise Exception(f\"Completed with {errored_tasks} failed tasks\")\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p1475","attributes":{"title":"Task Stream"
